        public static void createEngineConsistConfig(NS_EngineConsistObject NS_EngineObject) {

        	MIS_EngineConsistConfig engineConsistConfig = buildEngineConsistConfig(NS_EngineObject);

            string temp = System.Environment.GetEnvironmentVariable("TEMP");
            XmlSerializer serializer;
            FileStream fs;
            string request = "";

            EngineConsistConfig engineconsistconfig = engineConsistConfig.toSerializableObject();
            fs = File.Create(temp+"/temp.request");
            serializer = new XmlSerializer(typeof(EngineConsistConfig));
            var writer = new SteXmlTextWriter(fs);
            serializer.Serialize(writer, engineconsistconfig);
            fs.Close();

            request = File.ReadAllText(temp+"/temp.request");
            request = engineConsistConfig.toSteMessageHeader(request);
            System.IO.File.WriteAllText(SteUtils.getOutboundDir()+SteUtils.getFileName(), request);
        }
        
