        public EngineConsistConfig toSerializableObject() {
            EngineConsistConfig engineConsistConfig = new EngineConsistConfig();
            engineConsistConfig.Items = new object[2];

            EngineConsistConfigHEADER header = new EngineConsistConfigHEADER();
            if (this.HEADER != null)
            {
                if (this.HEADER.PROTOCOLID != null) {
                    header.PROTOCOLID = new EngineConsistConfigHEADERPROTOCOLID[1];
                    EngineConsistConfigHEADERPROTOCOLID protocolid = new EngineConsistConfigHEADERPROTOCOLID();
                    protocolid.Value = this.HEADER.PROTOCOLID;
                    header.PROTOCOLID[0] = protocolid;
                }
    
                if (this.HEADER.MSGID != null) {
